import Tdsidebar from '../edit_sidebar/tieude_sidebar';

function Audio() {
  return (
    <div className="news_video">
      <Tdsidebar title="Tin video" />
      <div className="news_nd_2">
        <Ndaudio />
        <Ndaudio />
        <Ndaudio />
      </div>
    </div>
  );
}
export default Audio;
